  <![if !mso]>
  <table cellpadding=0 cellspacing=0 width="100%">

    <div>
    <p style='text-align:justify;line-height:115%'><span lang=ES-MX
    style='font-size:16.0pt;line-height:115%;mso-fareast-font-family:"Times New Roman";
    mso-fareast-theme-font:minor-fareast;mso-ansi-language:ES-MX'>Se ha
    propagado la idea&nbsp;del aborto&nbsp;como símbolo de progreso. Hace más
    de 30 años el&nbsp;aborto&nbsp;fue introducido&nbsp;en&nbsp;los países
    democráticos, y muchos antes fue legalizado por la Unión Soviética en 1920,
    por la Alemania nazi, después por los demás países&nbsp;del&nbsp;Este.</span><span
    style='font-size:16.0pt;line-height:115%'><o:p></o:p></span></p>
    <p class=MsoNormal style='text-align:justify'><span style='font-size:16.0pt;
    line-height:107%;font-family:"Times New Roman",serif;mso-fareast-font-family:
    "Times New Roman";color:black;mso-fareast-language:ES-SV'>El hecho nuevo,
    la absoluta novedad histórica es la siguiente: Si la práctica del aborto
    está extendida desde hace tiempo, el abortismo como ideología parece ser un
    hecho escrito a la civilización occidental moderna. En efecto, ha ocurrido algo
    inédito y horrible, nuestra<o:p></o:p></span></p>
    <p class=MsoNormal style='text-align:justify'><span style='font-size:16.0pt;
    line-height:107%;font-family:"Times New Roman",serif;mso-fareast-font-family:
    "Times New Roman";color:black;mso-fareast-language:ES-SV'><span
    style='mso-spacerun:yes'> </span><o:p></o:p></span></p>
    </div>
    <![if !mso]></td>

    <p class=MsoNormal style='text-align:justify'><span style='font-size:16.0pt;
    line-height:107%;font-family:"Times New Roman",serif;mso-fareast-font-family:
    "Times New Roman";color:black;mso-fareast-language:ES-SV'>generación creía
    haberse liberado de las viejas ideologías, y sin darse cuenta se ha
    encontrado inmersa en una nueva ideología. Así, el aborto, en el siglo XX,
    se ha convertido incluso en un derecho Político.<o:p></o:p></span></p>
    <p class=MsoNormal style='text-align:justify'><span style='font-size:16.0pt;
    line-height:107%;font-family:"Times New Roman",serif'>Resulta paradójico,
    que hoy, cuando los modernos descubrimientos nos revelan las maravillas de
    la vida prenatal, y se puede seguir paso a paso el prodigio de la vida
    humana, no se nos permite siquiera hablar de ello. <o:p></o:p></span></p>
    <p class=MsoNormal style='text-align:justify'><span style='font-size:16.0pt;
    line-height:107%;font-family:"Times New Roman",serif'><o:p>&nbsp;</o:p></span></p>
